import React from 'react';
import data from '../data';

const Team = () => {
	return(
		<div class="row mt-lg-5 mt-4">
		{data.team.map((team)=>(
			<div class="col-md-4 team-gd text-center">
                <div class="team-img mb-4">
                    <img src={team.image} class="img-fluid" alt={team.name}/>
                </div>
                <div class="team-info">
                    <h3 class="mt-md-4 mt-3"><span class="sub-tittle-team">{team.title}</span>{team.name}</h3>
                    <p>Lorem Ipsum has been the industry's standard since the 1500s.</p>
                </div>
            </div>
			))
		}
        </div>
		);
}
export default Team;
